import React from 'react';
import './style.css';

const SkillsComponent = () => {

    const toolsTechnologies = [
      "Node.js",
      "Python",
      "SQL",
      "NoSQL",
      "Docker",
      "Git",
      "AWS",
      "RESTful APIs",
      "Java",
      "C++",
      "C",
      "JavaScript",
      "TypeScript",
      "React",
      "React Native",
      "PHP", 
      "MongoDB",
      "PostgreSQL",
      "Laravel",
      "Vue.js",
      "SSL/TLS",
    ];

    const softSkills = [
      "Comunicação Efetiva",
      "Trabalho em Equipe",
      "Resolução de Problemas",
      "Adaptabilidade",
      "Pensamento Crítico",
      "Gestão do Tempo",
      "Liderança",
      "Colaboração",
      "Empatia",
      "Criatividade"
    ];

    return (
      <div className="skills">
        <div>
          <h2>Ferramentas e Tecnologias</h2>
          <ul>
            {toolsTechnologies.map((tool, index) => (
              <li key={index}>
                <span className="icon">{getIconForTool(tool)}</span>
                {tool}
              </li>
            ))}
          </ul>
        </div>
        <div>
          <h2>Soft Skills</h2>
          <ul>
            {softSkills.map((skill, index) => (
              <li key={index}>
                <span className="icon">{getIconForSkill(skill)}</span>
                {skill}
              </li>
            ))}
          </ul>
        </div>
      </div>
    );
  }

function getIconForTool(tool) {
    // Return the corresponding icon for each tool
    // You can use FontAwesome or Material Icons here
    // Example: return <FontAwesomeIcon icon={["fab", "react"]} />;
}

function getIconForSkill(skill) {
    // Return the corresponding icon for each soft skill
    // You can use FontAwesome or Material Icons here
    // Example: return <FontAwesomeIcon icon="user-friends" />;
}

export default SkillsComponent;
